import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import './header.scss'
import EUR from '../imgs/eur.png'
import USD from '../imgs/images.png'


function Header() {
    return (
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Container>
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav" className={'justify-content-end'}>
                    <Nav >
                        <Navbar.Text><div className={'currency'}> <h3>USD</h3><img src={EUR}/></div> </Navbar.Text>
                        <Navbar.Text>40</Navbar.Text>
                        <Navbar.Text><div className={'currency'}><img src={USD}/></div> </Navbar.Text>
                        <Navbar.Text>40</Navbar.Text>

                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default Header;
